package com.michaelwomack.algorithms.assignments.number2;import edu.princeton.cs.algs4.StdIn;import java.util.Iterator;public class Permutation {    public static void main(String[] args) {        int numElements = Integer.parseInt(args[0]);        RandomizedQueue<String> rq = new RandomizedQueue<>();        while (!StdIn.isEmpty()) {            rq.enqueue(StdIn.readString());        }        Iterator<String> it = rq.iterator();        for (int i = 0; i < numElements && it.hasNext(); i++) {            System.out.println(it.next());        }    }}